import React, { Component } from "react";
import Link from 'next/link';

class App extends Component
{
    render()
    {
        return (
            <div>
                <div>
                    <Link href='/Home'><div>Home</div></Link>
                    <Link href='/About'><div>About</div></Link>
                    <Link href='/ContactUs'><div>Contact Us</div></Link>
                </div>
            </div>
        )
    }
}

export default App;
